import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion'; // For animations

// Styled container for the experience section
const ExperienceSection = styled.section`
  background-color: #f7f7f7;
  padding: 4em 2em;
  text-align: center;
`;

// Title for the section
const Title = styled.h1`
  font-size: 2.5em;
  font-family: 'Pacifico', cursive;
  color: #33;
  margin-bottom: 1em;
`;

// Experience list container
const ExperienceList = styled(motion.div)`
  max-width: 800px;
  margin: auto;
  text-align: left;
`;

// Experience item with Framer Motion hover effect
const ExperienceItem = styled(motion.div)`
  margin-bottom: 2em;
  background-color: white;
  font-family: 'Pacifico', cursive;
  border-radius: 15px;
  padding: 2em;
  box-shadow: 0px 10px 20px rgba(0, 0, 0, 0.1);
  position: relative;  /* Relative positioning to ensure z-index works */
  z-index: 1;          /* Default z-index */

  &:hover {
    z-index: 1000;    /* Bring the card to the front when hovered */
  }
`;

const JobTitle = styled.h3`
  font-size: 1.8em;
  color: #28a745;
  font-weight: bold;
  margin-bottom: 0.5em;
`;

const Company = styled.h4`
  font-size: 1.5em;
  color: #333;
  font-weight: bold;
`;

const Timeline = styled.h5`
  font-size: 1.1em;
  color: #888;
  margin-bottom: 1em;
`;

const RoleTitle = styled.h6`
  font-size: 1.2em;
  color: #555;
  font-weight: bold;
  margin-top: 1.5em;
  margin-bottom: 0.5em;
  background-color: #f0f0f0;
  padding: 0.5em;
  border-radius: 10px;
`;

const Description = styled.p`
  font-size: 1em;
  color: #555;
  line-height: 1.6;
`;

const BulletPoint = styled.li`
  font-size: 1em;
  margin: 0.5em 0;
  color: #666;
`;

// Framer Motion animation configuration
const experienceVariants = {
  hidden: { opacity: 0, y: 50 },
  visible: {
    opacity: 1,
    y: 0,
    transition: { duration: 0.8, ease: 'easeInOut', staggerChildren: 0.3 },
  },
};

const Experience = () => {
  return (
    <ExperienceSection>
      <Title>My Experience</Title>
      <ExperienceList
        initial="hidden"
        animate="visible"
        variants={experienceVariants} // Apply animation to the experience list
      >
        {/* BOSCH Experience */}
        <ExperienceItem
          variants={experienceVariants}
          whileHover={{ scale: 1.25 }} // Hover effect: scale up to 1.1
          transition={{ type: 'spring', stiffness: 200, damping: 15 }} // Smooth transition
        >
          <JobTitle>Associate Software Engineer (DevOps & Full Stack)</JobTitle>
          <Company>BOSCH Global Software Technologies, Bangalore, India</Company>
          <Timeline>Jul. 2023 - Present</Timeline>

          {/* DevOps Engineer Role */}
          <RoleTitle>DevOps Engineer Role</RoleTitle>
          <Description>
            <ul>
              <BulletPoint>∗ Architected and maintained CI/CD pipelines, slashing deployment time by 60% and improving application availability by 20%.</BulletPoint>
              <BulletPoint>∗ Engineered a custom Jenkins Plugin, reducing build times by 40% and increasing deployment accuracy by 25%.</BulletPoint>
              <BulletPoint>∗ Led Docker containerization, boosting application scalability by 30% and reducing deployment time by 50%.</BulletPoint>
              <BulletPoint>∗ Implemented auto-scaling in Kubernetes, cutting manual intervention by 60% and saving 20 hours per week.</BulletPoint>
              <BulletPoint>∗ Authored Python and Shell automation scripts, saving 20 hours weekly and improving task completion by 35%.</BulletPoint>
            </ul>
          </Description>

          {/* Full Stack Engineer Role */}
          <RoleTitle>Full Stack Engineer Role</RoleTitle>
          <Description>
            <ul>
              <BulletPoint>∗ Developed a “docs-as-code” framework reducing manual effort by 40 hours monthly.</BulletPoint>
              <BulletPoint>∗ Created an automated visualization tool integrating Sphinx with Graphviz and PlantUML, saving 15 hours monthly on visual tasks.</BulletPoint>
              <BulletPoint>∗ Integrated CI/CD-driven documentation solution with SCM tools like GitHub and Azure DevOps.</BulletPoint>
              <BulletPoint>∗ Deployed RBAC strategy on cloud infrastructure, ensuring secure project document visibility with zero data breaches.</BulletPoint>
              <BulletPoint>∗ Automated Sphinx documentation pipeline, reducing manual formatting time by 15 hours weekly.</BulletPoint>
            </ul>
          </Description>
        </ExperienceItem>

        {/* Google Summer of Code Experience */}
        <ExperienceItem
          variants={experienceVariants}
          whileHover={{ scale: 1.25 }} // Hover effect: scale up to 1.1
          transition={{ type: 'spring', stiffness: 200, damping: 15 }} // Smooth transition
        >
          <JobTitle>Google Summer of Code Contributor</JobTitle>
          <Company>Google Summer of Code 2022 - PEcAn Projects</Company>
          <Timeline>Jun. 2022 - Sept 2022</Timeline>
          <Description>
            <ul>
              <BulletPoint>∗ Refactored 10+ R packages for CRAN compliance, improving code quality and maintainability by 30%.</BulletPoint>
              <BulletPoint>∗ Engineered critical R functions to eliminate non-CRAN dependencies, reducing software maintenance by 40%.</BulletPoint>
              <BulletPoint>∗ Optimized download process for PEcAn packages, improving download speeds by 40%.</BulletPoint>
            </ul>
          </Description>
        </ExperienceItem>

      </ExperienceList>
    </ExperienceSection>
  );
};

export default Experience;
